import React from "react";
import ReactDOM from "react-dom";
import Add ,{Sub,Div} from "./Fun.jsx";

ReactDOM.render(
<>
<ul>
    <li>Sum of numbers is :{Add(10,10)} </li>
    <li>Substraction of numbers is :{Sub(10,10)} </li>
    <li>Division of two numbers is:{Div(10,5)}</li>
</ul>

</>,document.getElementById("root")
);
